var container = document.querySelector('.container');

let isDragging = false;
let startPosition;
let currentTranslate = 0;

container.addEventListener('mousedown', (e) => {
    isDragging = true;
    startPosition = e.pageX - container.offsetLeft;
    console.log(e)
    console.log(container.offsetLeft)
})

container.addEventListener('mouseup', () => {
    isDragging = false;
    currentTranslate = container.scrollLeft;

})

container.addEventListener('mousemove', (e) => {
    if (!isDragging) return;

    const currentPosition = e.pageX - container.offsetLeft;
    const distance = currentPosition - startPosition;
    container.scrollLeft = currentTranslate - distance;
});



images.forEach((el) => {
    container.innerHTML += 
        `<div class="card_image">
        <img src="${el.imagesURL}" alt="${el.city_name}" draggable="false">
        <span>${el.city_name}</span>
        </div>`;
})

